import React from 'react';

function CardAddress(props) {

    return (
    <div className='card-content-container'>
        <div className="title-card">
            <div className="number">Num. {props.address[1]["id"]}</div>
            <div className="title-cep">
                CEP: {props.address[1]["CEP"]}
            </div>
        </div>
        <div className="content-container">
        {props.address[1].name}
        <br/>
        {props.address[1].district}
        <br/>
        {props.address[1].region}
        <button onClick={(e) => (props.handleDelete(e, props.address[1]["id"]))} className="delete-button">Delete</button>
    </div>
    </div>

    )
}

export default CardAddress;
